css:
.autocomplete.select-list {
  box-sizing: content-box;
  margin-left: 0;
  margin-top: 0;
  padding-top: 0;
}
.autocomplete.select-list ol li {
  padding: 5px 0 5px 0;
  width: 100%;
  position: relative;
}
.autocomplete ol {
  box-sizing: content-box;
  position: relative;
  overflow-y: scroll;
  max-height: 200px;
  margin: 0 !important;
}
.autocomplete span {
  padding-left: 5px;
  padding-right: 5px;
}
.autocomplete .error-message {
  margin: 2px;
}
.autocomplete .fake-input {
  position: absolute;
  opacity: 0;
  pointer-events: none;
}
